        </div>
        <div>
          <h3>Feature 4</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 5</h3>
          <p>feature description</p>
        </div>
        <div>
          <h3>Feature 6</h3>
          <p>feature description</p>
        </div>
      </div>

      {/* REASONS COMPONENT */}
      <div>
        <div>
          <h2>Why Use This Product?</h2>
        </div>
        <div>
          <div>
            <h3>Reason 1</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 2</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 3</h3>
            <p>reason description</p>
          </div>
          <div>
            <h3>Reason 4</h3>
            <p>reason description</p>
          </div>
        </div>
      </div>

      {/* CALLTOACTION COMPONENT */}
